mapper.select:

select 

from FS_LTF_ACCT_INFO
where CR_TX_DT = #{crTxDt,jdbcType=VARCHAR}
  and POS_REF_NO = #{posRefNo,jdbcType=VARCHAR}
  and CR_POS_TX_SQ_NO = #{crPosTxSqNo,jdbcType=VARCHAR}
  and EC_FLG = #{ecFlg,jdbcType=VARCHAR}
  and TX_LOG_NO = #{txLogNo,jdbcType=VARCHAR}

mapper.delete:

delete from FS_LTF_ACCT_INFO
where CR_TX_DT = #{crTxDt,jdbcType=VARCHAR}
  and POS_REF_NO = #{posRefNo,jdbcType=VARCHAR}
  and CR_POS_TX_SQ_NO = #{crPosTxSqNo,jdbcType=VARCHAR}
  and EC_FLG = #{ecFlg,jdbcType=VARCHAR}
  and TX_LOG_NO = #{txLogNo,jdbcType=VARCHAR}
